import React from "react";
import SocialLinks from "./SocialLinks";
import avatar from "../assets/avatar.png";

export default function ProfileCard() {
    return (
    <div className="profile-card">
      <div className="avatar-container">
        <img src={avatar} alt="Avatar" className="avatar" />
      </div>
      <h1 className="name">Chloe Baker</h1>
      <p className="title">Environmental Engineer & PhD Student</p>
      <p className="bio">
        Passionate about advanced oxidation processes and environmental chemistry.
        Working on ozone nanobubbles for antimicrobial control and resistant microbes.
      </p>
      <div className="social-links">
        <SocialLink platform="LinkedIn" url="https://linkedin.com/in/chloebaker" />
        <SocialLink platform="GitHub" url="https://github.com/chloebaker" />
        <SocialLink platform="Email" url="mailto:chloe@example.com" />
      </div>
    </div>
  );
}
